import React, { useState, useEffect } from 'react';
import axios from 'axios';

function List({ email, startDate, endDate }) {
  const [spendingData, setSpendingData] = useState({});
  const sessionEmail = localStorage.getItem("email");

  useEffect(() => {
        axios.post('https://www.zoelindev.com/moneyCatBackend/list.php', { 
        email: sessionEmail,
        startDate: localStorage.getItem("startDate"),
        endDate: localStorage.getItem("endDate") })
      .then((response) => {
        setSpendingData(response.data);
      })
      .catch((error) => {
        console.error(error);
      });
  }, [email, startDate, endDate]);

  const renderTypeDetails = (type) => {
    const spendDetails = spendingData[type] || [];

    return (
      <div key={type}>
        <h2>{type}</h2>
        <table>
          <thead>
            <tr>
              <th>Date</th>
              <th>Note</th>
              <th>Cost</th>
            </tr>
          </thead>
          <tbody>
            {spendDetails.map(({ date, note, cost }) => (
              <tr key={`${date}-${note}`}>
                <td>{date}</td>
                <td>{note}</td>
                <td>{cost}</td>
              </tr>
            ))}
          </tbody>
        </table>
      </div>
    );
  };

  return (
    <div>
      {Object.keys(spendingData).map(renderTypeDetails)}
    </div>
  );
}

export default List;
